import React from 'react';
import './App.css';
import Category from './components/Category/Category.jsx';

const categories = null;

function App() {

  return (
    <>
      {categoriescategories.map((category, i) => (
        <Category key={i} name={category}></Category>
      ))}
    </>
  );
}

export default App;
